// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title DecentraID
 * @author Senior Blockchain Architect
 * @notice Production-grade Decentralized Identity (DID) Registry with high efficiency.
 */
contract DecentraID is ReentrancyGuard {
    
    struct Identity {
        string did;
        string metadataHash;
        bool isActive;
        uint256 createdAt;
        uint256 updatedAt;
    }

    // Storage
    mapping(address => Identity) private _identities;
    mapping(string => address) private _didToAddress;

    // Events
    event IdentityRegistered(address indexed user, string did, string metadataHash, uint256 timestamp);
    event IdentityUpdated(address indexed user, string newMetadataHash, uint256 timestamp);
    event IdentityRevoked(address indexed user, uint256 timestamp);

    /**
     * @notice Registers a unique Decentralized Identity linked to the msg.sender.
     * @param did The unique DID string (e.g., did:decentrid:0x...)
     * @param metadataHash IPFS content identifier for encrypted metadata.
     */
    function registerIdentity(string calldata did, string calldata metadataHash) external nonReentrant {
        require(bytes(did).length > 0, "Empty DID");
        require(bytes(metadataHash).length > 0, "Empty Metadata Hash");
        require(!_identities[msg.sender].isActive, "Identity already active");
        require(_didToAddress[did] == address(0), "DID already registered");

        _identities[msg.sender] = Identity({
            did: did,
            metadataHash: metadataHash,
            isActive: true,
            createdAt: block.timestamp,
            updatedAt: block.timestamp
        });

        _didToAddress[did] = msg.sender;

        emit IdentityRegistered(msg.sender, did, metadataHash, block.timestamp);
    }

    /**
     * @notice Updates the stored metadata hash for the sender's identity.
     * @param newMetadataHash The new IPFS CID.
     */
    function updateIdentity(string calldata newMetadataHash) external nonReentrant {
        require(_identities[msg.sender].isActive, "Identity not found");
        
        _identities[msg.sender].metadataHash = newMetadataHash;
        _identities[msg.sender].updatedAt = block.timestamp;

        emit IdentityUpdated(msg.sender, newMetadataHash, block.timestamp);
    }

    /**
     * @notice Checks if an address possesses an active identity.
     */
    function isIdentityActive(address user) external view returns (bool) {
        return _identities[user].isActive;
    }

    /**
     * @notice Retrieves the full identity structure for a given address.
     */
    function getIdentity(address user) external view returns (
        string memory did,
        string memory metadataHash,
        bool isActive,
        uint256 createdAt,
        uint256 updatedAt
    ) {
        Identity memory id = _identities[user];
        require(id.isActive, "Identity inactive");
        return (id.did, id.metadataHash, id.isActive, id.createdAt, id.updatedAt);
    }

    /**
     * @notice Permanently or temporarily revokes the sender's identity.
     */
    function revokeIdentity() external nonReentrant {
        require(_identities[msg.sender].isActive, "No active identity");
        
        _identities[msg.sender].isActive = false;
        
        emit IdentityRevoked(msg.sender, block.timestamp);
    }
}

